  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1947. The report begins by summarizing the weather conditions and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments.
  Resource management is outlined; topics include grazing, haying, and fur harvesting.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and violations. Short narrative reports on the North Platte National Wildlife Refuge
  and Box Butte National Wildlife Refuge is attached, as well as some N-R forms.\",\n\t\"owner_org\":
